import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

constructor(props){

  super(props)

  this.state = {

    board : Array(9).fill("X")

  }

}
render() {

  const Box= this.state.board.map(box => <div className="box">{box}</div>)

  return (

   <div className="container">

    <h1>TicTacToe></h1>

    <div className="board">

        {Box}

    </div>

   </div>

  );

 }

}

export default App;
